import React ,{Suspense}from 'react';
import logo from './logo.svg';
import './App.css';
const OtherComponent = React.lazy(() => import('./components/suspense'));

function App() {
  return (
    <div className="App">
      <header className="App-header">
      <Suspense fallback={<div>Loading...</div>}>

      <OtherComponent/>
      </Suspense>
      </header>
    </div>
  );
}

export default App;
